import axios from 'axios';
import React, { useState } from 'react';
import { useNavigate, useParams } from 'react-router-dom';

export default function LoginUser() {
  let navigate=useNavigate();


  const [user,setUser]=useState({
    email:"",
    password:""
  });

  const {email,password}=user;
 const[isEmailValid,setisEmailValid]=useState
  const onInputChange =(e)=>{
    setUser({...user,[e.target.email]:e.target.value});
  }

  const onSubmit =async(e)=>{
    e.preventDefault();
   const result = await axios.post("http://localhost:8080/login",user);
   navigate("/")
  };

  const checkEmail= async()=>{
    await axios.get("http://localhost:8080/save")
  }

  return (
    <div className="d-flex align-items-center " style={{ height: '70vh' }}>
      <div className="container">
        <div className="row ">
          <h7 className='text-between text-capitalize'><i>Login Here:</i></h7>
          <div className="col-md-6 offset-md-3 border bg-light rounded p-4 mt-2" style={{ height: '40vh' }}>
            <form>
              <div className="align-self-center">
                <div className="mb-3">
                  <label htmlFor="email" className="form-label d-flex justify-content-start">
                    Email:
                  </label>
                  <input
                    type="text"
                    className="form-control"
                    placeholder="Enter your email"
                  />
                </div>
                <div className="mb-3">
                  <label htmlFor="password" className="form-label d-flex justify-content-start">
                    Password:
                  </label>
                  <input
                    type="password"
                    className="form-control"
                    placeholder="Enter a Password"
                  />
                </div>
                <div className="d-flex justify-content-sm-start">
                  <button type="submit" className="btn btn-sm btn-dark rounded-pill">
                    Login
                  </button>
                </div>
              </div>
            </form>
          </div>
        </div>
      </div>
    </div>
  );
}
